import React from "react";
import { useEffect, useState } from "react";
import "./styles.css";
import WebSocket, {WebSocketServer} from "ws";
import ApexChart from 'apexcharts'
import ReactApexChart from 'react-apexcharts'

let user1_hr = 0;
let user1_rp = 0;
let user1_tp = 0;
const str = 'user1';

// let user1_hr = 0;
// let user1_rp = 0;
// let user1_tp = 0;
// const str = 'one';

const Detail = () => {
  const [message, setMessage] = useState('');
  const [hr, setHr] = useState([])
  const [rp, setRp] = useState([])
  const [tp, setTp] = useState([])
  const [categories, setCategories] = useState([])
  // const [message, setMessage] = useState('');


  useEffect(() => {
    setInterval(() => {
      const time = new Date(new Date().getTime());
      const timeStr = `${time.getMinutes().toString().padStart(2, '0')}:${time.getSeconds().toString().padStart(2, '0')}`;

      setCategories(prev => ([...prev, timeStr]))
    }, 3000)
    const WebSocket = require('ws');

    const socket = new window.WebSocket('ws://localhost:8080');

    socket.onmessage = (event) => {
      setMessage(event.data);

    let parse_data = JSON.parse(event.data)
    let ur = parse_data.user
    let hr = parse_data.heartrate
    let rp = parse_data.resp
    let tp = parse_data.temp
    // if (ur===str){
    //   console.log('hr: '+hr)
    //   user1_hr=hr;
    //   // console.log(message + "수신");
    // }

      // console.log(event)
      // const arr1 = event.data.split(",")
      // const timestamp = arr1[0]
      // const batteryLv = arr1[2]
      // const hr = Integer.parseInt(arr1[3])
      // const rp = Integer.parseInt(arr1[5])
      // const tp = Integer.parseInt(arr1[4])
      // const ur = arr1[9]
      if (parse_data.user === 'user1'){
        setHr(prev => ([...prev, hr]))
        setRp(prev => ([...prev, rp]))
        setTp(prev => ([...prev, tp]))
      }
      // setMessage(event.data);

      // let ur = parse_data.user
      // let rp = parse_data.resp
      // let tp = parse_data.temp

      // setHr(prev => ([...prev, hr]))

      // if (ur===str){
        // console.log('timestamp: '+timestamp)
        // console.log('batteryLv: '+batteryLv)
        // console.log('ur: '+ur)
        // console.log('hr: '+hr)
        // console.log('rp: '+rp)
        // console.log('tp: '+tp)
        // user1_hr=hr;
        // user1_rp=rp;
        // user1_tp=tp;
        // console.log(message + "수신");
      // }
    };

    return () => {
      if(socket.readyState===1){
        socket.close();
      }
    };
  }, []);

  useEffect(() => {
    console.log(hr)
    ApexCharts.exec('realtime', 'updateSeries', [{
      data: hr
    }])
  }, [hr])
  useEffect(() => {
    console.log(rp)
    ApexCharts.exec('realtime', 'updateSeries', [{
      data: rp
    }])
  }, [hr])
  useEffect(() => {
    console.log(tp)
    ApexCharts.exec('realtime', 'updateSeries', [{
      data: hr
    }])
  }, [hr])

  const option = {
    chart: {
      id: 'realtime',
      height: 350,
      type: 'line',
      animations: {
        enabled: true,
        easing: 'linear',
        dynamicAnimation: {
          speed: 1000
        }
      },
      toolbar: {
        show: false
      },
      zoom: {
        enabled: false
      }
    },
    dataLabels: {
      enabled: false
    },
    stroke: {
      curve: 'smooth'
    },
    title: {
      text: 'Dynamic Updating Chart',
      align: 'left'
    },
    markers: {
      size: 0
    },
    xaxis: {
      type: 'category',
      range: 10,
      categories:categories
    },
    legend: {
      show: false
    },
  }

  return (
    <div className="detail">
      <p>{message}</p>
      <div id="parent">
        <div id="title1"><p id="title11">Heart Rate</p><br/>
        <ReactApexChart options={option} series={[{data:hr}]} type="line" width={"100%"} height={350}/>
        </div>
        <div id="title2"><p id="title12">Respiration Rate</p><br/>
        <ReactApexChart options={option} series={[{data:rp}]} type="line" width={"100%"} height={350}/>
        </div>
        <div id="title3"><p id="title13">Body Temperature</p><br/>
        <ReactApexChart options={option} series={[{data:tp}]} type="line" width={"100%"} height={350}/>
        </div>
      </div>
    </div>
  );
}

export default Detail;
